import React from "react";

import {
  Container,
  Button,
  ButtonGroup,
  Center,
  Square,
  Circle,
  Box,
  Flex,
  Spacer,
  Heading,
} from "@chakra-ui/react";

const Landing = () => {
  return (
    <div>
      <box>
        {" "}
        <Button colorScheme="blue" to="/login">
          Login/Signup
        </Button>
      </box>

      <center>
        <Heading> Fantastic Happiness!</Heading>
      </center>

      <center> <Headers>Meet the Developers!</Headers></center>
      <Flex>
        <Box bg="gray.400" w="200px" h="200px">
          {" "}
          Dev Profile{" "}
        </Box>
        <Spacer />
        <Box bg="gray.400" w="200px" h="200px">
          {" "}
          Dev Profile{" "}
        </Box>
        <Spacer />
        <Box bg="gray.400" w="200px" h="200px">
          {" "}
          Dev Profile{" "}
        </Box>
        <Spacer />
        <Box bg="gray.400" w="200px" h="200px">
          {" "}
          Dev Profile{" "}
        </Box>
      </Flex>
    </div>
  );
};

export default Landing;
